int fputc(int ch, FILE *f)
{ 	
	while((USART1->SR&0X40)==0);
	USART1->DR = (uint8_t) ch;      
	return ch;
}

void Draw_ResetButtn(void)
{
       ILI9341_DrawRectangle(5, 260, 225, 50,0);
	ILI9341_DispString_EN(110,290,"RESET"); 
}

u8 findMax(float32_t *fx)
{
	u8 i,k=0;
	float32_t maxNum=0.0;
	maxNum=fx[0];
	for(i=1;i<10;i++)
	{
		if(maxNum<=fx[i])
		{
			maxNum=fx[i];
			k=i;
		}
	}
	return k;
}


void ImageToArray(){
    int i,j,k=0;
    for(j=0;j<28;j++){
        for(i=0;i<28;i++){
            imagex[k]=image[i][j];
            k++;
        }
        
    }

}

void ClearImageArray(){
    int i,j;
    for(i=0;i<28;i++){
        for(j=0;j<28;j++){
            image[i][j]=0;
            
        }
        
    }

}
