/**
  * @brief  The application entry point.
  * @retval int
  */
int main(void)
{
  /* USER CODE BEGIN 1 */
    u32 i;
    u8 res=0;
    char tempstr[30]={0};
    int X_width=0,Y_width=0;
    u32 pressT=0;
  /* USER CODE END 1 */

  /* MCU Configuration--------------------------------------------------------*/

  /* Reset of all peripherals, Initializes the Flash interface and the Systick. */
  HAL_Init();

  /* USER CODE BEGIN Init */

  /* USER CODE END Init */

  /* Configure the system clock */
  SystemClock_Config();

  /* USER CODE BEGIN SysInit */

  /* USER CODE END SysInit */

  /* Initialize all configured peripherals */
  MX_GPIO_Init();
  MX_FSMC_Init();
  MX_USART1_UART_Init();
  MX_USART3_UART_Init();
   MX_NVIC_Init();
  /* USER CODE BEGIN 2 */

  delay_init(168);  
    printf("init lcd\n");
	CurrentTextColor =  BLUE;
	CurrentBackColor = YELLOW;

    ILI9341_Init();
    ILI9341_GramScan (0);
    ILI9341_Clear(0, 0, 240, 320);
    ILI9341_Clear(0, 0, 240, 320);

    XPT2046_Init();
//    XPT2046_Touch_Calibrate(3);

 	Draw_ResetButtn();

	ILI9341_DrawRectangle(REG_LEFT, REG_LEFT, REG_RIGHT, REG_RIGHT,0);
      ILI9341_DrawRectangle(5, 260, 225, 50,0);
  /* USER CODE END 2 */

  /* Infinite loop */
  /* USER CODE BEGIN WHILE */

  while (1)
  {
    /* USER CODE END WHILE */
		XPT2046_TouchEvenHandler();
		
		if(touchStatus== TOUCH_PRESSED)			
		{	
				if(cinfo.x>5 && cinfo.x<250 && cinfo.y>250 && cinfo.y<310) /* reset button */
				{					
			             ILI9341_Clear(0, 0, 240, 320);
					
					ILI9341_DrawRectangle(REG_LEFT, REG_LEFT, REG_RIGHT, REG_RIGHT,0);
					Draw_ResetButtn();
					
					
				}
				else 
				{
					pressT=1;
					for(X_width=-5;X_width<=5;X_width+=1)
					{
						for(Y_width=-5;Y_width<=5;Y_width+=1)
						{
							
							ILI9341_SetPointPixel(cinfo.x+X_width,cinfo.y+Y_width);
							image[(cinfo.x+X_width)/MUTILP][(cinfo.y+Y_width)/MUTILP] = 1;
						}
					}	
                                 continue;
					
					
				}
			
		}
		else{
		    delay_ms(10);	
		}    
		if(pressT==1)
		{
			pressT=0;
			ImageToArray();

			for(i=0;i<INPUT_SIZE;i++){
				inputX[i]=imagex[i];
			        printf("%d,",(int)imagex[i]);
				if((i+1)%28==0){
                                printf("\n");
				}
			}		
			printf("\n");
			arm_mat_mult_f32(&input,&w1,&z1); //矩阵乘法 z1 = input*w1
			for(i=0;i<LAY1_OUT;i++){
				pz1[i]=pz1[i]+pb1[i];         //z1 = input*w1 +b1
			}	
			for(i=0;i<LAY1_OUT;i++){
				py2[i]=sigmoid(pz1[i]);     //y2=f(z1)
			}	
			arm_mat_mult_f32(&y2,&w2,&z2); //  z2= w2* y2 +b2
			for(i=0;i<LAY2_OUT;i++){
				pz2[i]=pz2[i]+pb2[i];
			}	
			for(i=0;i<LAY2_OUT;i++){
				py3[i]=sigmoid(pz2[i]);    //y3 = f(z2)
			}

			res=findMax(py3);
            sprintf(tempstr,"%d",res);
            printf(tempstr);
			ILI9341_DispString_EN(10,240,tempstr);
			res=0;
		    ClearImageArray();
						
		}		
    /* USER CODE BEGIN 3 */
  }
  /* USER CODE END 3 */
}

